{
  "openapi": "3.1.0",
  "info": {
    "title": "Astrology API",
    "description": "API for calculating astrological birth charts.",
    "version": "v1.0.0"
  },
  "servers": [
    {
      "url": "https://authorityastrology.com/api"
    }
  ],
  "paths": {
    "/astro-gpt": {
      "post": {
        "description": "Calculate an astrological birth chart.",
        "operationId": "CalculateBirthChart",
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "firstName": {
                    "type": "string",
                    "example": "Tim"
                  },
                  "email": {
                    "type": "string",
                    "format": "email",
                    "example": "tim@gmail.com"
                  },
                  "birthData": {
                    "type": "object",
                    "properties": {
                      "birthDate": {
                        "type": "string",
                        "format": "date",
                        "example": "1985-01-08"
                      },
                      "birthTime": {
                        "type": "string",
                        "format": "time",
                        "example": "06:08"
                      },
                      "birthLatitude": {
                        "type": "number",
                        "format": "float",
                        "example": 52.3511
                      },
                      "birthLongitude": {
                        "type": "number",
                        "format": "float",
                        "example": 4.6203
                      },
                      "placeOfBirth": {
                        "type": "string",
                        "example": "Heemstede, Netherlands"
                      }
                    },
                    "required": [
                      "birthDate",
                      "birthTime",
                      "birthLatitude",
                      "birthLongitude",
                      "placeOfBirth"
                    ]
                  }
                },
                "required": [
                  "firstName",
                  "email",
                  "birthData"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Successful response with birth chart data.",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "firstName": {
                      "type": "string"
                    },
                    "BirthData": {
                      "type": "object",
                      "properties": {
                        "birthDataA": {
                          "type": "object",
                          "properties": {
                            "birthDate": {
                              "type": "string",
                              "format": "date"
                            },
                            "birthTime": {
                              "type": "string",
                              "format": "time"
                            },
                            "birthLatitude": {
                              "type": "number",
                              "format": "float"
                            },
                            "birthLongitude": {
                              "type": "number",
                              "format": "float"
                            },
                            "placeOfBirth": {
                              "type": "string"
                            }
                          }
                        }
                      }
                    },
                    "Planets": {
                      "type": "object"
                    },
                    "HouseSystem": {
                      "type": "string"
                    },
                    "HouseCusps": {
                      "type": "array",
                      "items": {
                        "type": "number"
                      }
                    },
                    "Aspects": {
                      "type": "array",
                      "items": {
                        "type": "object"
                      }
                    },
                    "Patterns": {
                      "type": "object"
                    }
                  }
                }
              }
            }
          },
          "400": {
            "description": "Invalid request."
          },
          "500": {
            "description": "Internal server error."
          }
        }
      }
    }
  }
}
